			"properties": {
				"name": "Lingxia Bus Stop",
				"ele": "22.0",
				"desc": "'\u5CAD\u4E0B' in Chinese. The #792 bus will take you back to the starting point at Changjiang Road, via a scenic route through the mountains. Last bus is at 6pm."
			}
